func lengthOfLongestSubstring(s string) int {
    maxLen := 0
    //fmt.Println(s)
    for i, _ := range(s) {
        subs := map[int32]bool{}
        currLen := 0
        for _, c := range(s[i:]){
            //fmt.Println(string(c))
            _, ok := subs[c]
            if ok {
                //fmt.Println("seen")
                if currLen > maxLen {
                    maxLen = currLen
                }
                currLen = 0
                subs = map[int32]bool{}
            }
            subs[c] = true
            currLen++
        }
        if currLen > maxLen {
            maxLen = currLen
        }
    }

    return maxLen
}
